const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText } = wp.blockEditor;

registerBlockType("gb/simplecenteredheader", {
  title: __("Simple Centered", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "header",
  attributes: {
    contentUB: { type: "string", default: `Pricing` },
    contentUA: { type: "string", default: `Take control of your team.` },
    contentt: {
      type: "string",
      default: `Start building for free, then add a site plan to go live. Account plans unlock additional features.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;

    return (
      <div className="bg-white">
        
        <div className="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
          
          <div className="text-center">
            
            <h2 className="text-base font-semibold text-indigo-600 tracking-wide uppercase">
              <RichText
                value={attributes.contentUB}
                default={"Pricing"}
                onChange={(newtext) => setAttributes({ contentUB: newtext })}
              />
            </h2>
            <p className="mt-1 text-4xl font-extrabold text-gray-900 sm:text-5xl sm:tracking-tight lg:text-6xl">
              <RichText
                value={attributes.contentUA}
                default={"Take control of your team."}
                onChange={(newtext) => setAttributes({ contentUA: newtext })}
              />
            </p>
            <p className="max-w-xl mt-5 mx-auto text-xl text-gray-500">
              <RichText
                value={attributes.contentt}
                default={
                  "Start building for free, then add a site plan to go live. Account plans unlock additional features."
                }
                onChange={(newtext) => setAttributes({ contentt: newtext })}
              />
            </p>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;

    return (
      <div class="bg-white">
        
        <div class="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
          
          <div class="text-center">
            
            <h2 class="text-base font-semibold text-indigo-600 tracking-wide uppercase">
             <RichText.Content value={attributes.contentUB}/>
            </h2>
            <p class="mt-1 text-4xl font-extrabold text-gray-900 sm:text-5xl sm:tracking-tight lg:text-6xl">
             <RichText.Content value={attributes.contentUA}/>
            </p>
            <p class="max-w-xl mt-5 mx-auto text-xl text-gray-500">
             <RichText.Content value={attributes.contentt}/>
            </p>
          </div>
        </div>
      </div>
    );
  },
});
